import React, {Component} from 'react';
import Topsell from "./Topsell";

class Topsells extends Component {
    render() {
        return (
            <div className="topsell">
                <Topsell anhweb=".././img/web7.png" tentrang="Education" motaweb="Web tổ chức giáo dục" giaweb="1290k"/>
                <Topsell anhweb="img/web7.png" tentrang="Education" motaweb="Web tổ chức giáo dục" giaweb="1290k"/>
                <Topsell anhweb="img/web7.png" tentrang="Education" motaweb="Web tổ chức giáo dục" giaweb="1290k"/>

            </div>
        );
    }
}

export default Topsells;
